import { Route, Routes } from "react-router-dom";
import "./index.css";
import Home from "./routes/Home";

function App() {
  return (
     <>
      <Routes>
         <Route path="/" element={<Home/>}/>
         <Route path="/project" element={<Pro/>}/>

      </Routes>
     </>
  );
}

export default App;
